import { MDBContainer,  MDBCard, MDBCardBody, MDBCardTitle, MDBCardText, MDBBtn, MDBIcon  } from 'mdb-react-ui-kit';
import React from 'react';

export default function Story() {
  return (
    <MDBContainer className='mt-3 border py-4'>
      <MDBCard style={{ maxWidth: '5rem', minHeight:'5rem' }}>
        <MDBBtn rounded><MDBIcon fas icon="user-astronaut"/></MDBBtn>
      </MDBCard>
    </MDBContainer>
  );
}
